import sys

def main():
    N = int(sys.stdin.readline().rstrip())
    A = [list(map(int, sys.stdin.readline().rstrip().split())) for _ in range(N)]
    for i in range(N-2):
        if A[i][0] == A[i][1] and A[i+1][0] == A[i+1][1] and A[i+2][0] == A[i+2][1]:
            print("Yes")
            return
    print("No")
    return

